import React from "react";
import styled from "styled-components";

const MainContainer = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  height: 100vh;
  background-color: #fff8dc; /* Soft yellow */
  color: #5b3a29; /* Brown */
  font-family: "Press Start 2P", cursive; /* Pixel font */
`;

const Header = styled.h1`
  font-size: 2.5rem;
  margin-bottom: 20px;
`;

const Button = styled.button`
  background-color: #f28e36; /* Soft orange */
  border: 2px solid #b22222; /* Red */
  color: white;
  padding: 10px 20px;
  font-size: 1rem;
  cursor: pointer;
  margin-top: 20px;
  &:hover {
    background-color: #d2691e; /* Darker orange */
  }
`;

const MainPage = () => {
  return (
    <MainContainer>
      <Header>Welcome to CollectPie!</Header>
      <Button>Start Collecting</Button>
    </MainContainer>
  );
};

export default MainPage;
